        <g id="thoughts">

          
          <rect x="503.4" y="515.9" class="st7" width="196.9" height="21.5"/>
          <text transform="matrix(1 0 0 1 503.4221 523.4434)"><tspan x="0" y="0" class="st2 st6"> “¡Ahi!” Morena points to a building where she goes </tspan><tspan x="0" y="10.8" class="st2 st6">every Sunday to collect recyclables.</tspan></text>
        
        
          <rect x="546" y="544.1" class="st7" width="148.2" height="21.5"/>
          <text transform="matrix(1 0 0 1 546.0032 551.6788)"><tspan x="0" y="0" class="st2 st6"> “Ya Pasó,” Another canner was here </tspan><tspan x="0" y="10.8" class="st2 st6">before Morena.</tspan></text>
        
        
          <rect x="286.6" y="739.9" class="st7" width="184" height="21.5"/>
          <text transform="matrix(1 0 0 1 328.2581 747.4327)"><tspan x="0" y="0" class="st2 st6">“¡Ay!” Morena yells to someone who is </tspan><tspan x="3.8" y="10.8" class="st2 st6">maneuvering the car in a wrong way.</tspan></text>
          
          <rect x="371.3" y="1229.7" class="st7" width="208.8" height="34.6"/>
          <text transform="matrix(1 0 0 1 375.0447 1237.2833)"><tspan x="0" y="0" class="st2 st6">“¡Aquí habrá muchas!” Morena points to a construction </tspan><tspan x="12.9" y="10.8" class="st2 st6">site of a luxury condo and imagines the amount ¡¡of </tspan><tspan x="111.4" y="21.6" class="st2 st6">cans that it will generate. </tspan></text>
          
          <text transform="matrix(1 0 0 1 683.1956 1267.8824)" class="st2 st6"> “¡Mira!” Morena points to a cart locked to a street pole, like a bike. </text>
          
          <rect x="198.8" y="1319.7" class="st7" width="301.4" height="21.7"/>
          <text transform="matrix(1 0 0 1 210.9724 1327.2003)"><tspan x="0" y="0" class="st2 st6">“Soy bruta!” Morena self describe her as stupid because she can’t remember a </tspan><tspan x="67.3" y="10.8" class="st2 st6">code to get into the basement where the garbage is stored.</tspan></text>
          
          <rect x="430.5" y="2195.4" class="st7" width="240.6" height="23.2"/>
          <text transform="matrix(1 0 0 1 430.4651 2202.8857)"><tspan x="0" y="0" class="st2 st6">“Mira este,” Morena points to the small statue of a owl that </tspan><tspan x="0" y="10.8" class="st2 st6">emits a sound when someone passes in front. She loves it!</tspan></text>
          

          <rect x="528.2" y="2342.6" class="st7" width="199.7" height="28.4"/>
          <text transform="matrix(1 0 0 1 528.2004 2350.1025)"><tspan x="0" y="0" class="st2 st6">“Aquí mataron uno,” Morena points to a street alter </tspan><tspan x="0" y="10.8" class="st2 st6">for someone who has been recently killed.</tspan></text>
        
        
          <rect x="445.4" y="2391.9" class="st7" width="168.5" height="26.5"/>
          <text transform="matrix(1 0 0 1 445.3909 2399.4336)"><tspan x="0" y="0" class="st2 st6">“Me gusta,” Morena points to a murales </tspan><tspan x="0" y="10.8" class="st2 st6">made with crochet that she likes.</tspan></text>
        
        
          <text transform="matrix(1 0 0 1 468.5027 2541.9824)" class="st2 st6">“¡Ay que fresquito!” Morena closes her eyes and enjoys the breeze.</text>
          
          <text transform="matrix(1 0 0 1 497.0583 2715.9043)"><tspan x="0" y="0" class="st2 st6">“¡Que suerte! The garage gate of the building where Morena wants to </tspan><tspan x="0" y="10.8" class="st2 st6">get in is open. Sometimes she waits for over 30 minutes. </tspan></text>
          <rect x="194.1" y="2818.1" class="st7" width="200.1" height="42"/>
          <text transform="matrix(1 0 0 1 219.2498 2825.5869)"><tspan x="0" y="0" class="st2 st6">“¡Espera!” after moving the trash bags from the </tspan><tspan x="-19.6" y="10.8" class="st2 st6">garage to the curb in perfect order, she waits for the </tspan><tspan x="51.5" y="21.6" class="st2 st6">gate’s closing, for tenants’ safety.</tspan></text>
          
          <rect x="479.9" y="3144.7" class="st7" width="196" height="40.3"/>
          <text transform="matrix(1 0 0 1 479.8718 3152.1963)"><tspan x="0" y="0" class="st2 st6">“Me duele,” Morena complains about her right leg, </tspan><tspan x="0" y="10.8" class="st2 st6">injured while canning. Her left foot hurts too: last </tspan><tspan x="0" y="21.6" class="st2 st6">week she stepped on a piece of glass.</tspan></text>
     
          <rect x="678.1" y="954.5" class="st7" width="148.8" height="30.4"/>
          <text transform="matrix(1 0 0 1 678.0667 961.9947)"><tspan x="0" y="0" class="st2 st6">“Ya Pasó,” Morena realizes another </tspan><tspan x="0" y="10.8" class="st2 st6">canner passed in one of her spots.</tspan></text>
          <rect x="624.5" y="741" class="st7" width="200.1" height="34"/>

          <text transform="matrix(1 0 0 1 624.4543 748.5811)"><tspan x="0" y="0" class="st2 st6">“Somos demasiados,” Morena complains about the </tspan><tspan x="0" y="10.8" class="st2 st6">number of canners while another chinese canner </tspan><tspan x="0" y="21.6" class="st2 st6">passes by.</tspan></text>
        </g>
        <g id="encounters">
          <g>
            <text transform="matrix(1 0 0 1 521.8474 660.8848)" class="st2 st6">Chinese Canner</text>
          </g>
          <rect x="773.5" y="774.9" class="st7" width="176.9" height="34"/>
          <text transform="matrix(1 0 0 1 773.5237 782.3946)"><tspan x="0" y="0" class="st2 st6">Morena goes into a building to leave her </tspan><tspan x="0" y="10.8" class="st2 st6">recyclables with an old woman who keeps </tspan><tspan x="0" y="21.6" class="st2 st6">them for few hours.</tspan></text>
          <rect x="753.9" y="818.6" class="st7" width="176.9" height="34"/>
          <text transform="matrix(1 0 0 1 753.8616 826.1187)"><tspan x="0" y="0" class="st2 st6"> Morena meets two friends who live in the </tspan><tspan x="0" y="10.8" class="st2 st6">neighborhood. They stop to chat about </tspan><tspan x="0" y="21.6" class="st2 st6">clothing.</tspan></text>
          <text transform="matrix(1 0 0 1 467.4133 835.606)" class="st2 st6">An acquaintance passing by.</text>
          <rect x="671.2" y="906.3" class="st7" width="200.1" height="23.6"/>
          <text transform="matrix(1 0 0 1 671.2219 913.8033)"><tspan x="0" y="0" class="st2 st6">She meets a friend on wheelchair and stops to </tspan><tspan x="0" y="10.8" class="st2 st6">exchange a few words.</tspan></text>
          <text transform="matrix(1 0 0 1 372.511 1211.5558)" class="st2 st6">Morena crosses path with three other canners in just one block.</text>
          <rect x="175.8" y="1265.2" class="st7" width="290.4" height="18.6"/>
          <text transform="matrix(1 0 0 1 175.8801 1272.7018)"><tspan x="0" y="0" class="st2 st6">Morena stops at an auto repair shop. “No party this Saturday, I got nothing for </tspan><tspan x="132.1" y="10.8" class="st2 st6">you today,” one of the workers says to her.</tspan></text>
          <text transform="matrix(1 0 0 1 231.4036 1300.754)"><tspan x="0" y="0" class="st2 st6">The building’s super, Luis, comes to open the garage gate. Morena greets </tspan><tspan x="41.2" y="10.8" class="st2 st6">two men, Hasidic jews, who are inside talking on their phones.</tspan></text>
          <rect x="575.2" y="1317.1" class="st7" width="314" height="37.1"/>
          <text transform="matrix(1 0 0 1 575.1624 1324.6412)"><tspan x="0" y="0" class="st2 st6">A passerby offers the empty can she holds. Morena accepts with a smile, but knows </tspan><tspan x="0" y="10.8" class="st2 st6">that specific brand of coconut water is not redeemable.</tspan></text>

          <rect x="575.2" y="1347.6" class="st7" width="243" height="24"/>
          <text transform="matrix(1 0 0 1 575.1624 1355.1178)"><tspan x="0" y="0" class="st2 st6">The super of a building which garbage is left on the curb every </tspan><tspan x="0" y="10.8" class="st2 st6">Monday around noon.</tspan></text>

          <rect x="351.9" y="1910.3" class="st7" width="191.1" height="25.9"/>
          <text transform="matrix(1 0 0 1 351.8928 1917.8492)"><tspan x="0" y="0" class="st2 st6">She meets chocolate, another woman who goes to </tspan><tspan x="0" y="10.8" class="st2 st6">sure we can to redeem recyclables.</tspan></text>
          <text transform="matrix(1 0 0 1 340.6311 2098.666)" class="st2 st6">Morena stops to talk with a lady and her dog.</text>
          <rect x="264.9" y="2313.3" class="st7" width="199.9" height="34.7"/>
          <text transform="matrix(1 0 0 1 315.7781 2320.8125)"><tspan x="0" y="0" class="st2 st6">Morena stops to chat with two old men.</tspan><tspan x="-33.6" y="10.8" class="st2 st6">They make jokes. One says she’s his “esposa”, the </tspan><tspan x="-27.9" y="21.6" class="st2 st6">other hits Morena’s cart with his cane, playfully. </tspan></text>
          <rect x="507.1" y="3041.4" class="st7" width="214.4" height="39.4"/>
          <text transform="matrix(1 0 0 1 507.0833 3048.958)"><tspan x="0" y="0" class="st2 st6">People distributing food in front of a church. Morena </tspan><tspan x="0" y="10.8" class="st2 st6">gets some bread and leaves an offer next to the sign: “No </tspan><tspan x="0" y="21.6" class="st2 st6">misericordia sem gasolina.”</tspan></text>
          <rect x="402.9" y="3201.6" class="st7" width="236.6" height="39.4"/>
          <text transform="matrix(1 0 0 1 402.8606 3209.166)"><tspan x="0" y="0" class="st2 st6">Morena stops to get her bottles and cans at the place of that </tspan><tspan x="0" y="10.8" class="st2 st6">old woman that was keeping them from the morning.</tspan></text>

          
          
          
          
          
          
          <polygon class="st7" points="216.2,1293.2 505,1293.2 504.9,1312.7 216.2,1312.7  "/>
          
        </g>
        <g id="collections">
          <rect x="464.3" y="1693.1" class="st7" width="239.1" height="37.1"/>
          <text transform="matrix(1 0 0 1 464.3376 1700.6349)"><tspan x="0" y="0" class="st2 st6">A man driving a truck slows down to hand Morena the empty </tspan><tspan x="0" y="10.8" class="st2 st6">pepsi can he’s holding out of the vehicle window. </tspan></text>
          <text transform="matrix(1 0 0 1 326.8928 1947.9962)" class="st2 st6">Stop at Sure We Can to empty her cart.</text>
          <text transform="matrix(1 0 0 1 417.6985 3387.9961)" class="st2 st6">Back at Sure We Can. She does her sorting until 6 pm, then goes home to eat.</text>
          <rect x="497.1" y="2708.4" class="st7" width="268.6" height="42"/>

        <g id="francesca_comments">
          <text transform="matrix(1 0 0 1 411.1604 290.6949)"><tspan x="0" y="0" class="st2 st6">Morena’s prediction for the morning is to </tspan><tspan x="0" y="10.8" class="st2 st6">make 5 to 10 dollars, which she refers to as </tspan><tspan x="0" y="21.6" class="st2 st6">“pesos.”</tspan></text>   
          <rect x="256.4" y="643.8" class="st7" width="171.5" height="54.1"/>

            c8.2,0,15,6.8,15,15V314.1z"/>

            c8.2,0,15,6.8,15,15V673.3z"/>

          <text transform="matrix(1 0 0 1 256.4133 650.2051)"><tspan x="0" y="0" class="st2 st6">After walking for a few minutes among </tspan><tspan x="0" y="10.8" class="st2 st6">bagels trucks in a outdoor garage space, </tspan><tspan x="0" y="21.6" class="st2 st6">Morena looks a bit disappointed.</tspan></text>
            
          <path class="st12" d="M629.7,902.6c0,8.2-6.8,15-15,15H448.4c-8.2,0-15-6.8-15-15v-29c0-8.2,6.8-15,15-15h166.4c8.2,0,15,6.8,15,15V902.6z"/>
            
          <rect x="446.3" y="867.6" class="st7" width="171.5" height="54.1"/>
          <text transform="matrix(1 0 0 1 446.3103 874.0001)"><tspan x="0" y="0" class="st2 st6">I was surprised about Morena’s knowledge </tspan><tspan x="0" y="10.8" class="st2 st6">on elegant dresses and accessories. This </tspan><tspan x="0" y="21.6" class="st2 st6">episode triggered the discovery of her </tspan><tspan x="0" y="32.4" class="st2 st6">“secret.”</tspan></text>
            
          <path class="st12" d="M374.2,1388.9c0,8.2-6.8,15-15,15H192.9c-8.2,0-15-6.8-15-15v-29c0-8.2,6.8-15,15-15h166.4
            c8.2,0,15,6.8,15,15V1388.9z"/>
            
          <rect x="190.8" y="1353.9" class="st7" width="171.5" height="54.1"/>
          <text transform="matrix(1 0 0 1 190.8279 1360.3131)"><tspan x="0" y="0" class="st2 st6"> Canners and supers build mutual trust. Some </tspan><tspan x="0" y="10.8" class="st2 st6">canners pay a few dollars to access the </tspan><tspan x="0" y="21.6" class="st2 st6">building, other bring presents to express </tspan><tspan x="0" y="32.4" class="st2 st6">gratitude.</tspan></text>
            
          <path class="st12" d="M480,1453.1c0,8.2-6.8,15-15,15H298.7c-8.2,0-15-6.8-15-15v-29c0-8.2,6.8-15,15-15H465c8.2,0,15,6.8,15,15
            V1453.1z"/>
            
          <rect x="296.6" y="1418.1" class="st7" width="171.5" height="54.1"/>
          <text transform="matrix(1 0 0 1 296.6121 1424.5338)"><tspan x="0" y="0" class="st2 st6">Morena sorted more than 15 bags of trash, </tspan><tspan x="0" y="10.8" class="st2 st6">black bags included. She left the place tidy </tspan><tspan x="0" y="21.6" class="st2 st6">and clean, with a small present for the super. </tspan></text>
            
          <path class="st12" d="M690.6,2784.9c0,8.2-6.8,15-15,15H509.2c-8.2,0-15-6.8-15-15v-29c0-8.2,6.8-15,15-15h166.4
            c8.2,0,15,6.8,15,15V2784.9z"/>
            
          <rect x="507.2" y="2749.9" class="st7" width="171.5" height="54.1"/>
          <text transform="matrix(1 0 0 1 507.177 2756.2754)"><tspan x="0" y="0" class="st2 st6">The informal activity of canning depends on </tspan><tspan x="0" y="10.8" class="st2 st6">precision. If Morena doesn’t show up every </tspan><tspan x="0" y="21.6" class="st2 st6">Monday at 2pm, she may lose her exclusive </tspan><tspan x="0" y="32.4" class="st2 st6">access.</tspan></text>
            
          <path class="st12" d="M430.6,2795.8c0,8.2-6.8,15-15,15H249.2c-8.2,0-15-6.8-15-15v-8.4c0-8.2,6.8-15,15-15h166.4
            c8.2,0,15,6.8,15,15V2795.8z"/>
            
          <rect x="247.2" y="2781.4" class="st7" width="171.5" height="27.9"/>
          <text transform="matrix(1 0 0 1 247.1643 2787.8232)"><tspan x="0" y="0" class="st2 st6">I can’t believe she hasn’t eaten or drunk since </tspan><tspan x="0" y="10.8" class="st2 st6">7am, I’m starving!</tspan></text>
        </g>
